desc:
When an opponent's monster declares an attack: Activate 1 of these effects;
? Banish 1 "D/D/D" monster from your Graveyard, and if you do, the attacking monster loses ATK equal to the banished monster's ATK.
? Add 1 Level 4 or lower "D/D" Pendulum Monster from your Deck to your hand.

You can only use the following effect of "Junk Changer" once per turn. If this card is Normal or Special Summoned: You can target 1 "Junk" monster on the field, then activate 1 of these effects;
? Increase its Level by 1.
? Reduce its Level by 1.

Activate 1 of these effects;
? Gain 1200 LP.
? Inflict 800 damage to your opponent.

If you have no Spell/Trap Cards in your Graveyard, you can Special Summon this card (from your hand). After this card was Special Summoned this way, you cannot Special Summon monsters for the rest of this turn, except "Superheavy Samurai" monsters. You can Tribute this card, then activate 1 of these effects;
? Destroy 1 card in your opponent's Spell & Trap Zone, then you can Set the destroyed Spell/Trap Card on your side of the field.
? Destroy 1 card in your opponent's Pendulum Zone, then you can place the destroyed card in your Pendulum Zone.

Cannot attack the turn it is Summoned. While you control "Toon World" and your opponent controls no Toon monsters, this card can attack your opponent directly. Once per turn: You can discard 1 "Toon" card or "Manga Ryu-Ran", then activate 1 of these effects;
? Special Summon 1 Toon monster from your Deck, except "Toon Dark Magician", ignoring its Summoning conditions.
? Add 1 "Toon" Spell/Trap Card from your Deck to your hand.

You can banish this card from your Graveyard to activate 1 of these effects;
? Increase the Level of all "Mermail" monsters you currently control by 1.
? Increase the Level of all "Mermail" monsters you currently control by 2.

Activate 1 of these effects;
? Add 1 Wyrm monster from your Deck to your hand.
? Send any number of Wyrm monsters from your hand and/or face-up from your field to the GY; draw cards equal to the number of monsters you sent to the GY +1.

All "Rokket" monsters on the field gain 300 ATK/DEF. You can only use the following effect of "Revolve Boot Sector" once per turn. You can activate 1 of these effects;
? Special Summon up to 2 "Rokket" monsters with different names from your hand in Defense Position.
? If your opponent controls more monsters than you do: Special Summon "Rokket" monsters with different names from your GY in Defense Position, up to the surplus.

Once per turn, during either player's turn: You can discard 1 "Ninja" monster, then activate 1 of these effects;
? This turn, "Ninja" monsters and "Ninjitsu Art" cards you control cannot be destroyed by battle or card effects.
? 1 "Ninja" monster you control gains 1000 ATK until the end of this turn.

Once per turn, during either player's turn: You can discard 1 "Ninja" monster, then activate 1 of these effects;
? This turn, "Ninja" monsters and "Ninjitsu Art" cards you control cannot be destroyed by battle or card effects.
? 1 "Ninja" monster you control gains 1000 ATK until the end of this turn.

Every "Dark Magician" in your Monster Zone is unaffected by your opponent's card effects. If this face-up card leaves the field: Destroy all monsters you control. You can only use the following effect of "Eternal Soul" once per turn. You can activate 1 of these effects;
? Special Summon 1 "Dark Magician" from your hand or Graveyard.
? Add 1 "Dark Magic Attack" or "Thousand Knives" from your Deck to your hand.

Every "Dark Magician" in your Monster Zone is unaffected by your opponent's card effects. If this face-up card leaves the field: Destroy all monsters you control. You can only use the following effect of "Eternal Soul" once per turn. You can activate 1 of these effects;
? Special Summon 1 "Dark Magician" from your hand or GY.
? Add 1 "Dark Magic Attack" or "Thousand Knives" from your Deck to your hand.

Once per turn: You can discard 1 card, then activate 1 of these effects;
? Add 1 Level 4 or lower "Dragunity" monster from your Deck to your hand.
? Send 1 Dragon-Type monster from your Deck to the Graveyard.

Once per turn: You can discard 1 card, then activate 1 of these effects;
? Add 1 Level 4 or lower "Dragunity" monster from your Deck to your hand.
? Send 1 Dragon monster from your Deck to the GY.

Target 1 face-up monster on the field and activate 1 of these effects;
? Increase that target's Level by 1.
? Reduce that target's Level by 1.

Cannot be used as a Synchro Material. Up to twice per turn: You can target 1 "Constellar" monster on the field, then activate 1 of these effects;
? Increase its Level by 1.
? Reduce its Level by 1.

Activate 1 of these effects;
? If you control an "Odd-Eyes" card: Target 1 card on the field; destroy it.
? Add to your hand, 1 Level 7 "Odd-Eyes" monster from your Deck, or 1 face-up Level 7 "Odd-Eyes" Pendulum Monster from your Extra Deck.

When a Spell/Trap Card, or monster effect, that targets exactly 1 "Graydle" monster you control (and no other cards) is activated: Activate 1 of these effects;
? The activated effect becomes "Destroy that monster".
? Negate the activation, and if you do, destroy that card.

Up to twice per turn, if this card was Special Summoned by the effect of a "Dododo" monster this turn: You can target 1 "Dododo" monster you control, then activate 1 of these effects;
? Increase its Level by 1.
? Reduce its Level by 1.

Target 1 Spellcaster-Type monster on the field and activate 1 of these effects;
? That face-up monster is unaffected by other Spell effects this turn.
? That face-up monster is unaffected by Trap effects this turn.

Cannot be Special Summoned. When this card is Normal Summoned: You can target 1 of your banished Level 4 or lower "Blackwing" monsters; Special Summon it in Defense Position. You can banish this card from the GY to activate 1 of the following effects;
?Place Black Feather Counter(s) on 1 "Black-Winged Dragon" you control, equal to the number of card(s) your opponent controls.
?Place 1 Wedge Counter on each face-up monster your opponent controls that does not have one.

You take no battle damage from attacks involving your co-linked monsters. Once per turn: You can activate 1 of these effects;
? Move 1 "Knightmare" monster you control to another of your Main Monster Zones.
? Switch the locations of 2 "Knightmare" monsters in your Main Monster Zones.

Send this card to the GY during your 2nd Standby Phase after activation. You can only use the following effect of "Photon Change" once per turn. Send 1 "Photon" or "Galaxy" monster you control to the GY to activate 1 of these effects, or, if you send "Galaxy-Eyes Photon Dragon", you can activate both, in sequence;
?Special Summon 1 "Photon" monster from your Deck with a different original name than the sent monster.
?Add 1 "Photon" card from your Deck to your hand, except "Photon Change".

Once per turn: You can target 1 Ritual Monster you control; show 1 Ritual Monster in your hand, until the end of this turn. The Level of the shown Ritual Monster becomes the targeted monster's Level, until the end of this turn (even if this card leaves the field). Once per turn, if "Ruin, Queen of Oblivion" or "Demise, King of Armageddon" is Ritual Summoned to your field (except during the Damage Step): You can activate 1 of these effects;
? Draw 1 card.
? Destroy 1 card on the field.

To activate this card, you must draw it for your normal draw in your Draw Phase, reveal it, and keep it revealed until the Main Phase 1. During your Main Phase 1 that same turn: You can activate this card from your hand and target 1 "Utopia" Xyz Monster you control, then activate 1 of these effects;
? Equip any number of "ZW -" monsters with different names from your Deck and/or Extra Deck to that monster.
? Special Summon from your Extra Deck, 1 "Utopia" Xyz Monster with a different name, by using that target as material. (This is treated as an Xyz Summon. Transfer its materials to the Summoned monster.)
